              <NavLink to="/tools"></NavLink>
            </li>
            <li className="login">
              <NavLink to="/login"></NavLink>
            </li> */}
            <li className="contact">
              <NavLink to="/contact">Contact</NavLink>
            </li>
          </ul>
      </div>
    </nav>
  )
};

export default Nav;
